import {React, useEffect} from 'react'
import FetchApi from './fetchApi/FetchApi'

const ProductList = () => {

  useEffect(() => {
    FetchApi('http://localhost:4000/products')
  }, [])
  
  return (
    <div className='container'>
      ProductList
      </div>
  )
}

export default ProductList
